Reis mee door het leven en de herinneringen van Barney Panofsky (Paul Giamatti), een sigaren rokende, stevig drinkende en 
grofgebekte TV producer die er niet voor terugdeinst mensen tegen zich in het harnas te jagen. De grootste hekel heeft hij 
echter aan een ex-politieman die in zijn memoires heeft geschreven waarom hij Barney al jaren van moord verdenkt. Het boek 
dwingt Barney, terwijl het laatste hoofdstuk van zijn eigen bestaan hem steeds scherper voor ogen komt te staan, terug te 
blikken.
